create table recipes_secret
(
    Id               int          not null
        primary key,
    ResultNameId     int unsigned not null,
    ResultTypeId     int unsigned not null,
    ResultLevel      int unsigned not null,
    IngredientIdsCSV mediumtext   not null,
    QuantitiesBin    mediumtext   not null,
    JobId            int          not null,
    SkillId          int          not null
)
    engine = MyISAM
    charset = utf8;

